import React, { useState, useEffect, useRef } from 'react';
import CircularText from './CircularText';
import './App.css';

function App() {
  const [visibleSections, setVisibleSections] = useState(new Set());
  const sectionRefs = useRef({});

  useEffect(() => {
    const observers = new Map();

    const observerOptions = {
      threshold: 0.3,
      rootMargin: '-10% 0px -10% 0px'
    };

    const handleIntersection = (sectionId) => (entries) => {
      entries.forEach(entry => {
        if (entry.isIntersecting) {
          setVisibleSections(prev => new Set([...prev, sectionId]));
        }
      });
    };

    // Create observers for each section
    Object.keys(sectionRefs.current).forEach(sectionId => {
      const element = sectionRefs.current[sectionId];
      if (element) {
        const observer = new IntersectionObserver(
          handleIntersection(sectionId),
          observerOptions
        );
        observer.observe(element);
        observers.set(sectionId, observer);
      }
    });

    return () => {
      observers.forEach(observer => observer.disconnect());
    };
  }, []);

  const setSectionRef = (sectionId) => (el) => {
    sectionRefs.current[sectionId] = el;
  };

  const professionals = [
    { title: 'Developers', icon: 'üíª', description: 'Code the future' },
    { title: 'Programmers', icon: '‚ö°', description: 'Build solutions' },
    { title: 'Visionaries', icon: 'üåü', description: 'Dream bigger' },
    { title: 'Designers', icon: 'üé®', description: 'Craft experiences' }
  ];

  const buildingCategories = [
    { title: 'Crypto', icon: '‚Çø', gradient: 'linear-gradient(135deg, #f093fb, #f5576c)', description: 'Decentralized future' },
    { title: 'AI Agents', icon: 'ü§ñ', gradient: 'linear-gradient(135deg, #4facfe, #00f2fe)', description: 'Intelligent automation' },
    { title: 'Clothing Line', icon: 'üëî', gradient: 'linear-gradient(135deg, #43e97b, #38f9d7)', description: 'Fashion forward' },
    { title: 'Media Pod', icon: 'üéôÔ∏è', gradient: 'linear-gradient(135deg, #fa709a, #fee140)', description: 'Content creation' },
    { title: 'Health Tech', icon: 'üè•', gradient: 'linear-gradient(135deg, #a8edea, #fed6e3)', description: 'Wellness innovation' },
    { title: 'SaaS', icon: '‚òÅÔ∏è', gradient: 'linear-gradient(135deg, #667eea, #764ba2)', description: 'Software solutions' }
  ];

  return (
    <div className="App">
      {/* Hero Section */}
      <section className="cinematic-section hero-section">
        <div className="container">
          <h1 className="main-title">Buildathon</h1>
          <div className="circular-text-overlay">
            <CircularText
              text=" GENZ 5-9 QUIT CLUB GENZ"
              onHover="speedUp"
              spinDuration={20}
              className="custom-class"
            />
          </div>
        </div>
        <div className="scroll-indicator">
          <div className="scroll-arrow">‚Üì</div>
        </div>
      </section>

      {/* Intro Section */}
      <section 
        className={`cinematic-section intro-section ${visibleSections.has('intro') ? 'visible' : ''}`}
        ref={setSectionRef('intro')}
      >
        <div className="cinematic-content">
          <h2 className="cinematic-title">Building the Future</h2>
          <p className="cinematic-subtitle">Where innovation meets ambition</p>
          <div className="cinematic-tagline">
            <span>For creators.</span>
            <span>For builders.</span>
            <span>For dreamers.</span>
          </div>
        </div>
      </section>

      {/* For Section */}
      <section 
        className={`cinematic-section for-section ${visibleSections.has('for') ? 'visible' : ''}`}
        ref={setSectionRef('for')}
      >
        <div className="cinematic-content">
          <div className="section-intro">
            <h2 className="section-title">For</h2>
            <p className="section-description">The minds that shape tomorrow</p>
          </div>

          <div className="cinematic-grid">
            {professionals.map((prof, index) => (
              <div 
                key={index} 
                className="cinematic-card"
                style={{ animationDelay: `${index * 0.2}s` }}
              >
                <div className="card-icon">{prof.icon}</div>
                <h3 className="card-title">{prof.title}</h3>
                <p className="card-description">{prof.description}</p>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Building Section */}
      <section 
        className={`cinematic-section building-section ${visibleSections.has('building') ? 'visible' : ''}`}
        ref={setSectionRef('building')}
      >
        <div className="cinematic-content">
          <div className="section-intro">
            <h2 className="section-title">Building</h2>
            <p className="section-description">Industries we're revolutionizing</p>
          </div>

          <div className="cinematic-grid building-grid">
            {buildingCategories.map((category, index) => (
              <div 
                key={index} 
                className="cinematic-card building-card"
                style={{ animationDelay: `${index * 0.15}s` }}
              >
                <div 
                  className="card-icon building-icon"
                  style={{ background: category.gradient }}
                >
                  {category.icon}
                </div>
                <h3 className="card-title">{category.title}</h3>
                <p className="card-description">{category.description}</p>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section 
        className={`cinematic-section cta-section ${visibleSections.has('cta') ? 'visible' : ''}`}
        ref={setSectionRef('cta')}
      >
        <div className="cinematic-content">
          <h2 className="cta-title">Ready to Build?</h2>
          <p className="cta-subtitle">Join the next generation of creators</p>
          <button className="cta-button">Start Building</button>
        </div>
      </section>
    </div>
  );
}

export default App;
